  [],\n\t\"revision_timestamp\": \"2015-09-26T21:58:39.737223\",\n\t\"name\": \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-frocdef6\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109919 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the East China
  Sea (Tung Hai), North Pacific Ocean, Papahanaumokuakea Marine National Monument,
  Philippine Sea and Sea of Japan from 2005-10-31 to 2006-01-30 and retrieved during
  cruise 49NZ20051031 (49MR0505/1/2/3). These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DELTA
  CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SIGMA-T, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these
  data include Alkalinity titrator, CTD, Coulometer for DIC measurement, Spectrophometer
  for pH measrement and bottle. These data were collected by Akihiko Murata and Shuichi
  Watanabe of Japan Agency for Marine-Earth Science and Technology (Jamstec) as part
  of the CLIVAR_P03_2005 data set.nnThe International CLIVAR Global Ocean Carbon and
  Repeat Hydrography Program carries out a systematic and global re-occupation of
  select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
